import React, { useState, useEffect } from 'react';
import axios from 'axios';

function ViewGoods() {
  const [scannedData, setScannedData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('/api/scanned-data'); // Replace with your API endpoint
        setScannedData(response.data);
      } catch (error) {
        console.error('Error fetching scanned data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <table>
      <thead>
        <tr>
          <th>Item</th>
          <th>Quantity</th>
          <th>Expiry Date</th>
          <th>Weight</th>
          <th>Item ID</th>
          <th>Scan Date</th>
          <th>Scanned Quantity</th>
        </tr>
      </thead>
      <tbody>
        {scannedData.map((item, index) => (
          <tr key={index}>
            <td>{item.item}</td>
            <td>{item.quantity}</td>
            <td>{item.expiryDate}</td>
            <td>{item.weight}</td>
            <td>{item.itemId}</td>
            <td>{item.scanDate}</td>
            <td>{item.scannedQuantity}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default ViewGoods;
